      <p className="mb-6 text-gray-700">You do not have access to this page.</p>
      <Link to="/" className="bg-blue-600 text-white px-4 py-2 rounded hover:bg-blue-700">
        Go Home
      </Link>
    </div>
  );
};

export default Unauthorized;
